title: Site1
tagline: Bab Webseite
description: A minimal, responsive and feature-rich Jekyll theme for technical writing.
url: ''
baseurl: ''
author: Region AZUR

# Language and Timezone
lang: en
timezone: Europe/Zurich

# Theme Settings
theme: jekyll-theme-chirpy

# Collections Definition
# This ensures Jekyll processes your custom folders and the theme's tabs correctly
permalink: /:title

collections:
  tabs:
    output: true
  content:
    output: true
    permalink: /:title

# Manual Includes
# Ensure Jekyll looks into these directories during the build process
include:
  - _tabs
  - content
  - _plugins

# Defaults for Front Matter
defaults:
  - scope:
      path: "" # Apply to all files first
    values:
      layout: page
      toc: true
  - scope:
      path: "_tabs"
    values:
      layout: page
  - scope:
      path: "content"
    values:
      layout: page # This ensures hello-world.md uses your custom layout

# PWA Settings
pwa:
  enabled: true
  cache:
    deny_paths: []

# Social Links
social:
  name: Region AZUR
  links:
    - https://region-azur.ch
avatar: >-
  data:image/png;base64,
